import '../css/work.css';

function Work(){
    return(
        <>
            <div className="third">
                <div className="third_1">
                        <span className="num">02</span>

                </div>
        </div>

        <div className="third2">
            <h1 className="title">
                <span className="text">Work</span>
                <div className="title_l">
                    <span className="s_name1">WORK</span><br />
                </div>
            </h1>

        </div>
        <div className="work">
          <img src="../img/work.png"/>
        </div>
    </>
    );
}
export default Work;
